### 段落

这是一段普通的文本。

段落之间需要空行。

换行需要使用 `<br>` 或者加上两个空格。

字体可以使用 *斜体* 或者 **粗体** 或者 ***斜粗体***。

删除线可以使用 ~~删除线~~。

### 无序列表

- 列表项 1
- 列表项 2
- 列表项 3

### 有序列表

1. 列表项 1
2. 列表项 2
3. 列表项 3

