exports.startup = () => {
  const { md } = $tw.Wiki.parsers['text/markdown'].prototype;

  const getname = (name) => `./markdown-it-${name}`;

  const extensions = [
    'abbr',
    'emoji',
    'github-alert',
    'pangu',
    'smartarrows',
    'front-matter',
  ];

  extensions.forEach((extension) => {
    md.use(require(getname(extension)));
  });
};
